import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1, //makes it occupy the whole space left
    backgroundColor: '#F0F0F7',
  },

  teacherList: {
    marginTop: -40
  },
});

export default styles;
